// React imports
import React, {
  useState,
  useEffect
} from 'react';
import Nav from 'react-bootstrap/Nav';

// Import CSS for the homepage
import './css/Home.css';

// State for the homepage message
function Home() {
  const [homeMessage, setHomeMessage] = useState(0);

  // Fetch the message from the API and update state
  useEffect(() => {
    fetch('/api/v1/home_message').then(res => res.json()).then(data => {
      setHomeMessage(data.message);
    });
  }, []);

  // Use the message inside the centered text box
  return (
    <Nav className="navbar fixed-top joe-navbar">
      <a className="joe-brand" href="/">Joe Wlos</a>
      <button 
        class="navbar-toggler" 
        type="button" 
        data-toggle="collapse" 
        data-target="#navbarNavDropdown" 
        aria-controls="navbarNavDropdown" 
        aria-expanded="false" 
        aria-label="Toggle navigation"
      >
        <span class="navbar-toggler-icon"></span>
      </button>
      <div class="collapse navbar-collapse" id="navbarNavDropdown">
      <ul class="navbar-nav">
        <li class="nav-item dropdown">
          <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
            Dropdown link
          </a>
          <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
            <a class="dropdown-item" href="/">Action</a>
            <a class="dropdown-item" href="/">Another action</a>
            <a class="dropdown-item" href="/">Something else here</a>
          </div>
        </li>
      </ul>
    </div>
    </Nav>
  );
}

export default Home;
